import { Text, View, StyleSheet} from 'react-native';

const Header = () => {
    <View style={styles.container}>
        <Text style={styles.title}></Text>
    </View>
    
}

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#2196f3',
      alignItems: 'center',
      justifyContent: 'center',
    },
    title: {

        textSize: '24px',
    },
  });

export default Header;
